import React from 'react';
import './ReportPreview.scss';

const ReportPreview = ({ template }) => {
  
  const reportData = {
    title: 'Sample Event Title',
    duration: '2024-09-13 10:00 - 12:00',
    location: 'Sample Location',
    pictures: [
      'https://via.placeholder.com/400',
      'https://via.placeholder.com/400'
    ]
  };

  return (
    <div className={`report-preview ${template}`}>
      <h2>Report Preview - {template}</h2>
      <div className={template}>
        <div className="header">{reportData.title}</div>
        <div className="details">
          <p><strong>Duration:</strong> {reportData.duration}</p>
          <p><strong>Location:</strong> {reportData.location}</p>
        </div>
        <div className="pictures">
          {reportData.pictures.map((pic, index) => (
            <img key={index} src={pic} alt={`Event Pic ${index + 1}`} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default ReportPreview;
